import "../side/side.css";

const Side = () => {
  return (
    <sidenav>
      <div className="container-fluid">
        <h1 className="font-weight-bold">
          Arab <span>Lionz</span>
        </h1>
        <div className="all">
          <ul className="types">
            <li className="films">
             <button></button> {" "}
              <ul className="typefilm">
                <li>Ziad</li>
                <li>adel</li>
                <li>fathy</li>
              </ul>
            </li>
            <li className="seires">seires</li>
            <li>
              {" "}
              by <span>Ziad Adel</span>
            </li>
          </ul>
        </div>
      </div>
    </sidenav>
  );
};
export default Side;
